INSERT INTO `news` (`id`, `ruTitle`, `ruText`, `ruText1`, `ruText2`, `ruText5`, `ruText6`, `ruDescription`, `image`, `ruHeadline`, `enHeadline`, `enDescription`, `date`, `createdAt`, `updatedAt`) VALUES
(7, 'Битва Лидеров', 'Лучший способ получить пассивный доход', 'Арена лидеров', 'В настоящее время, пользователей которые не умеют приглашать, или попросту не хотят приглашать, для них была задумана программа БИТВА ЛИДЕРОВ...', 'Что это такое?', 'Это ринг где лучшие из лучших бьются за первое место,\r\nгде в конце победитель получает вознаграждение, собранное от каждого пользователя.', ' Раз в неделю мы будем принимать заявки от лидеров,\r\nкоторые хотят учавствовать в битве,\r\nдалее будет создано объявление, посредством информационных ресурсов\r\nо предстоящей битве.', 'round.png', 'game-details-thumb.png', 'Каждый пользователь, который верит в победу \r\nтого или иного лидера, делает на него ставку.\r\nКаждому пользователю который сделал ставку, (минимальная ставка 100р)\r\nбудет закрыто одно место на площадке Kepler X1 в его цепи,\r\nкоторое он выберет еще до начала битвы.\r\nПобедитель битвы получит вознаграждение в размере 90% процентов \r\nот собранной суммы и 10% получит проигравший.\r\nДанный метод позволит вам и вашим партнерам получать переливы\r\nв разы быстрее, а следовательно ускорит движение по столам.', NULL, '2023-02-04 18:41:32', '2022-12-01 00:52:27', '2022-10-08 09:52:34');
